export default function Navbar() {
	return (
		<nav>
			<img
				src='https://res.cloudinary.com/codelikeagirl29/image/upload/v1660019829/earth_fhxoz7.png'
				className='nav--logo'
			/>
			<h3>travel journal</h3>
		</nav>
	);
}
